Map {
User Stories {
Display Unsupported Orders: As a user, I want to be able to view orders that are not supported by the volleyball application.
Select Travel Time: As a user, I want to be able to select a travel time for my volleyball game.
Create Team: As a user, I want to be able to create a team for my volleyball game.
View Team Members: As a user, I want to be able to view the members of my team.
Schedule Games: As a user, I want to be able to schedule games for my team.
View Game Results: As a user, I want to be able to view the results of my team's games.
Send Invitations: As a user, I want to be able to send invitations to other players to join my team.
}

Administrative Tasks {
Manage Teams: As an administrator, I want to be able to manage teams and their members.
Manage Games: As an administrator, I want to be able to manage games and their results.
Manage Invitations: As an administrator, I want to be able to manage invitations sent to players.
}

}
